import './AddProject.css'
import { useState } from 'react'
import { ReactComponent as AddIcon } from '../assets/add.svg'
import { createProject } from './../ApiCaller.js'

const AddProject = () => {
    
  const [project, setProject] = useState("");

  const handleSubmit = (event) => {
    event.preventDefault();
    alert(`The name you entered was: ${project}`)
    createProject(project)
    
  }

    return (
        <div className="create">
            <div>
            <form onSubmit={handleSubmit}>
                <input type="submit" value="New project" className='create-button'></input>
                <div>
                    <input type="text" required maxLength={20} value={project} onChange={(e) => setProject(e.target.value)}>
                    </input>
                    
                </div>
            </form>
            </div>
        </div>
    )
}

export default AddProject
